html, body{
  height: 100%;
  width: 100%;
  margin: 0;
}
#app {
  height: 100%;
  width: 100%;
}
.control-box{
  padding: 10px;
  button{
    padding: 6px 10px;
    font-size: 14px;
    background: rgb(247, 245, 245);
    border: 1px solid rgb(149, 215, 253);
    border-radius: 4px;
    height: 14px;
    line-height: 14px;
    box-sizing: content-box;
  }
}
.tree-wrapper{
  position: absolute;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
}
.group-image{
  position: fixed;
  bottom: 20px;
  right: 20px;
  img{
    width: 300px;
  }
  h6{
    padding: 0;
    margin: 0;
  }
}
